  justifyContent: 'center',
};

function App() {
  return (
    <section>
      <div style={styles}>
        <h1>Thanaporn </h1>
      </div>
      <div style={styles}>
        <GitHubAvatar size={50} /> {/* You can change the size here */}
      </div>
      <div style={styles}>
        <GitHubRepoURL url="https://github.com/thanapornjanbuala">
          {/* Optional: Provide custom text inside the link */}
          My GitHub Repository
        </GitHubRepoURL>
      </div>
    </section>
  );
}

export default App;
